  <div>
    <ol id="color-buttons">
      <li><button class="color-button" onclick="setHighlightColor('one')" style="background-color: #9AF43B;"></button></li>
      <li><button class="color-button" onclick="setHighlightColor('two')" style="background-color: #00DBFF;"></button></li>
      <li><button class="color-button" onclick="setHighlightColor('three')" style="background-color: #F23DE1;"></button></li>
      <li><button class="color-button" onclick="setHighlightColor('brenda')" style="background-color: #FC1408;"></button></li>
      <li><button class="color-button" onclick="setHighlightColor('ana')" style="background-color: #00FF6D;"></button></li>
      <li><button class="color-button" onclick="setHighlightColor('mel')" style="background-color: #0099FF;"></button></li>
      <li><button class="color-button" onclick="setHighlightColor('howard')" style="background-color: #FC4708;"></button></li>
    </ol>
  </div>



  <script type="text/javascript">
    function setHighlightColor(color) {
      $.each(selectedCounties, function (index,county){
        $(`#${highlightColor} [data-name="${county}"]`).css('visibility','hidden')
      });

      highlightColor = color;

      $.each(selectedCounties, function (index,county){
        $(`#${highlightColor} [data-name="${county}"]`).css('visibility','visible')
      });
    }

    function selectCounty(county) {
      if ( $(`#${highlightColor} [data-name="${county}"]`).css('visibility') == 'hidden' ) {
        $(`#${highlightColor} [data-name="${county}"]`).css('visibility','visible');

        // Add county to selected counties
        selectedCounties.push(county);

      } else {
        $(`#${highlightColor} [data-name="${county}"]`).css('visibility','hidden');

        // Remove county from selected counties
        var index = selectedCounties.indexOf(county);
        if (index > -1) {
          selectedCounties.splice(index, 1);
        }

      }
    }

    // Set initial highlight color
    setHighlightColor('one');

    // Initialize variable to store array of selected counties
    var selectedCounties = [];

    // Turn on or off the highlight on click
    $(document).on("click",".county-area", function () {
      var county = $(this).attr('id');
      selectCounty(county);
    });
  </script>
